import React from "react";
import styled from 'styled-components';
const Wrapper = styled.div`
  width: 250px;
  height: 501px;
  position: absolute;
  box-shadow: inherit;
  right: 80px;
  top: -105px;
  background-image: url("https://mobilestream.ru//landing/images/mobileid/iphone-transparent.png");
  background-size: contain;
  display: flex;
  div {
    overflow: hidden;
  }
  img {
    position: relative;    
    top: 68px;
    left: 16px;
  }
`


export const Slider: React.FC<ISlider> = props => (
    <Wrapper>
        <div>
            {props.imgArray.map(img => <img src={img} alt="slide" width="218px" height="382px"/>)}
        </div>
    </Wrapper>
);

interface ISlider {
    imgArray: string[];
}
